import styled from 'styled-components'

const StyledSection = styled.section`
  margin: auto;
  margin-bottom: 1em;
  height: 500px;
  width: 500px;
`


const Section = props => (
  <StyledSection>
    {props.children}
  </StyledSection>
)

export default Section
